import React from "react";

export default ({ input }) => {
  //console.log(props.input);
  // {...input} == onChange(input.onChange) onBlur(input.onBlur) etc... handles all these onSomething meathods by react
  return (
    <div>
      <input {...input} />
    </div>
  );
};
